package JavaFebPractice;

public class RelationalOperatorsPractice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		 int a = 5;int b = 15;
		 System.out.println("a is " + a + " and b is " + b);
		 
		 System.out.println(a != b); 
		 
		 System.out.println(a > b);
		 
		 System.out.println(a < b);
		 
		 System.out.println(a <= b);
		 
		 System.out.println(a >= b);
		 
		 System.out.println(a == b);

	}

}
